const headerElement = document.getElementById('header');
const suggestElement = document.querySelector('hub-suggest-input');
const iframeElement = document.getElementById('county-report');
const iframeCode = document.getElementById('iframe-code');
const iframeSrc = document.getElementById('iframe-src');
const calciteAlert = document.querySelector('calcite-alert');
const calciteAlertMsg = document.getElementById('calcite-alert-message');
const urlParams = new URLSearchParams(window.location.search);
const embedModal = document.querySelector("calcite-modal");

window.onload = function () {

    const embed = urlParams.get('embed');
    if (embed) {
        headerElement.style.display = "none";
        iframeElement.style.height = "100vh";
    }

    const county = urlParams.get('county');
    if (county !== undefined && county !== null && county.length > 0) {
        suggestElement.query = county
        loadReport(county);
    }
}
suggestElement.addEventListener('querySelect', event => {
    urlParams.set('county', event.detail);
    window.history.replaceState({}, '', `${window.location.pathname}?${urlParams}`);
    loadReport(event.detail);
})

function loadReport(countyName) {
    let selectedCounty = counties.filter((county) => {
        return countyName == county.name;
    })
    let embedUrl = `https://bao.arcgis.com/InfographicsPlayer/ArcGISPro/BA_Covid19_Counties/${selectedCounty[0].fips}.html`;
    iframeElement.src = embedUrl;

    iframeSrc.value = embedUrl;
    iframeCode.value = `<iframe src="${embedUrl}" height="500" width="100%"></iframe>`;
    results.style.opacity = "1.0";
}
function copyText(inputId) {
    /* Get the text field */
    var copyText = document.getElementById(inputId);

    /* Select the text field */
    copyText.select();
    copyText.setSelectionRange(0, 99999); /*For mobile devices*/

    /* Copy the text inside the text field */
    document.execCommand("copy");

    // Hides the popover
    setTimeout(function () {
        var el = document.getElementById(`${inputId}-popover`);
        console.log("Timeout", el)
        el.open = false;
        el.removeAttribute("open")
    }, 1000)
}
